module.exports = function (nemo, cb) {
	switch ('foo') {
		case 'bar':
			nemo.driver.sleep(100);
			break;
		case 'foo':
			getagain(nemo, cb);
			break;
		default:
			nemo.driver.sleep(100);
			break;
	}
};

function getagain(nemo, cb) {
	nemo.driver.get('http://www.google.com');
	getyetagain(nemo, cb);
}
function getyetagain(nemo, cb) {
	nemo.driver.get('http://www.google.com');
	explode(nemo, cb);
}
function explode(nemo, cb) {
	nemo.driver.wait(reallyexplode(nemo)).then(cb);
}
function reallyexplode(nemo) {
	return nemo.driver.sleep(1).then(function () {
		nemo.driver.sleep(1).then(function () {
			return nemo.view.goo.noexistVisible();
		})
	});

}